import { TOAST_MESSAGE_REQUEST } from "./actionTypes";

export const toastMessage = (
  data = { body: String, isSuccess: Boolean, time: Number }
) => {
  return {
    type: TOAST_MESSAGE_REQUEST,
    data,
  };
};
